import React from 'react';
import './App.css';
import Products from './Products'

const App: React.FC = () => {
  return (
    <div className='App'>
      <header>
        <a href='/App'>Home</a>
        <a href='/App'>Services</a>
        <a href='/Product'>Products</a>
      </header>
      <Products></Products>
    </div>
  );
}

export default App;
